import React from "react";
import axios from "axios";

const employee = ({posts}) => {
  return (
    <div>
      <h1>Employee Directory</h1>
      <ul>
        {posts.map(post =>(
          <li key={post.id}>{post.email}</li>
        ))}
      </ul>
    </div>
  );
};

employee.getInitialProps = async () => {
  const res = await axios.get("https://randomuser.me/api/?results=7");
  const {data} = res;
  return {posts:data};
};

export default employee;





































